body:
By looking at the code within ILSpy, the failure happens when the code tries to load a resource satellite assembly (`TMCTools&`) from the embedded resource stream of the module dll. The relevant code snippet is as follows:

```c#
// From BitmapDictionary.ClearTemplate()
Stream manifestResourceStream = executingAssembly.GetManifestResourceStream(text);
byte[] rawAssembly = ResourceTable.ClearTemplate(97L, manifestResourceStream);
return Assembly.Load(rawAssembly);
```
So yeah, it's likely the code depends on an implementation detail that may have changed in .NET 6, and the tool owner needs to investigate further. The weird thing is, `97L` is passed to `ResourceTable.ClearTemplate` but is never used anywhere in the actual implementation of that method.
